import { HttpClient } from "@angular/common/http";


@Injectable({
  providedIn: 'root'
})
export class AuthServiceService {

  constructor(private http: HttpClient ) { }



signupUser(data: any){
return this.http.post(this.apiUrlProfile, data)
}

getLoginUser(){
  return this.http.get(this.apiUrlProfile)
}

}
